CREATE TABLE `goi_dich_vu` (
  `id` int NOT NULL AUTO_INCREMENT,
  `ma_thiet_bi` varchar(50) DEFAULT NULL COMMENT 'Mã thiết bị (nullable until assigned)',
  `nguoi_dung_id` varchar(50) DEFAULT NULL COMMENT 'ID người dùng (nullable until assigned)',
  `ngay_bat_dau` datetime DEFAULT NULL COMMENT 'Ngày bắt đầu sử dụng (nullable until activated)',
  `ngay_ket_thuc` datetime DEFAULT NULL,
  `gia` decimal(10,2) DEFAULT NULL,
  `trang_thai` enum('CHUA_THANH_TOAN','CHUA_GAN_THIET_BI','DANG_HOAT_DONG','HET_HAN','HUY') NOT NULL DEFAULT 'CHUA_THANH_TOAN' COMMENT 'Trạng thái gói dịch vụ',
  `phuong_thuc_thanh_toan` varchar(50) DEFAULT NULL,
  `ma_giao_dich` varchar(100) DEFAULT NULL,
  `thong_tin_goi_id` int DEFAULT NULL,
  `phu_huynh_id` int DEFAULT NULL COMMENT 'ID của phụ huynh mua gói',
  `ngay_mua` datetime DEFAULT NULL COMMENT 'Ngày mua gói',
  `vnp_txn_ref` varchar(100) DEFAULT NULL COMMENT 'Mã giao dịch VNPay',
  `vnp_order_info` text COMMENT 'Thông tin đơn hàng VNPay',
  `vnp_response_code` varchar(10) DEFAULT NULL COMMENT 'Mã phản hồi từ VNPay',
  `vnp_transaction_status` varchar(20) DEFAULT NULL COMMENT 'Trạng thái giao dịch VNPay',
  PRIMARY KEY (`id`),
  KEY `nguoi_dung_id` (`nguoi_dung_id`),
  KEY `fk_thong_tin_goi` (`thong_tin_goi_id`),
  KEY `idx_phu_huynh_id` (`phu_huynh_id`),
  KEY `idx_ngay_mua` (`ngay_mua`),
  KEY `idx_vnp_txn_ref` (`vnp_txn_ref`),
  KEY `idx_vnp_response_code` (`vnp_response_code`),
  CONSTRAINT `fk_goi_dich_vu_phu_huynh` FOREIGN KEY (`phu_huynh_id`) REFERENCES `phu_huynh` (`ma_phu_huynh`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_thong_tin_goi` FOREIGN KEY (`thong_tin_goi_id`) REFERENCES `thong_tin_goi` (`id`),
